import React from "react";
import cityList from "./city-weather";

function CityList() {
    console.log(cityList);
  return (
    <div>
      {cityList.map((city) => (
        // <City name={city.name} countryCode={city.sys.country} main={city.weather[0].main}/>
      <City city ={city}/>
      ))}
    </div>
  );
}

function City({city}) {
    //object destructuring
    const {name, weather:[{main,description}],} = city;
  return (
    <div>
      <h2>{name}</h2>
      <h2> {main}</h2>
    </div>
  );
}

export default CityList;
